const initialState = {
  responses_1 :[ 1, 2],
  responses_2 :[],
  response_time_1 :[],
  response__time_2 :[],
  contrast_1 :[],
  contrast_2 :[],
  test: 1,
}


const rtReducer = (state = initialState, action) => {
    switch (action.type) {
      case 'ADD_ITEM':
        return state + 1
      case 'ADD_ARRAY':
        return state - 1
      default:
        return state
    }
  }
  
  export default rtReducer
